import assert from "assert";
import {huffman_decode_dictionary} from "./huffman_decode_dictionary.js";

describe('#huffman_decode_dictionary()', function () {
    it.skip('1', function() {
        let data = '1 1 \na: 0\n0\n';
        assert.equal(huffman_decode_dictionary(data), 'a');
    });

    it.skip('2', function() {
        let data = '4 14 \na: 0\nb: 10\nc: 110\nd: 111\n01001100100111\n';
        assert.equal(huffman_decode_dictionary(data), 'abacabad');
    });

    it.skip('3', function() {
        let data = '19 34\np: 1111011\no: 1111100\nr: 1111101\nc: 1111110\ne: 1111111\nn: 1011\n' +
            'k: 110\n' +
            'v: 11100\n' +
            's: 111010\n' +
            'a: 111011\n' +
            'm: 111100\n' +
            'u: 1111010\n' +
            'f: 00\n' +
            'j: 010\n' +
            'd: 011\n' +
            'g: 1000\n' +
            'h: 1001\n' +
            'b: 10100\n' +
            'l: 10101\n' +
            '\n';
        assert.equal(huffman_decode_dictionary(data), ''.repeat(30));
    });
});
